import React, { Component } from 'react';
import './headerNav.scss';
import $ from 'jquery';
import { Input, Button } from 'antd';
const { Search } = Input;

class HeaderNav extends Component {
    componentDidMount() {
        $(window).scroll(res => {
            if($(window).scrollTop() > 10){
                $(".header-nav").css({
                    'box-shadow': '0 0 10px 0 rgba(0,0,0,.4)',
                    '-webkit-box-shadow': '0 0 10px 0 rgba(0,0,0,.4)',
                    '-moz-box-shadow': '0 0 10px 0 rgba(0,0,0,.4))',
                    '-o-box-shadow': '0 0 10px 0 rgba(0,0,0,.4)'
                })
            } else {
                $(".header-nav").css({
                    'box-shadow': 'none',
                    '-webkit-box-shadow': 'none',
                    '-moz-box-shadow': 'none',
                    '-o-box-shadow': 'none'
                })
            }
        })
    }
    handleSearch = value => {
      this.props.passSearch(value)
    };

    render() {
      console.log(this.props)
        return (
            <div className="header-nav">
                <div className="nav-important">
                  <Link to={``} target="_blank">
                    <div className="logo">
                        <img src={require('../../../assets/images/logo.png')}/>
                    </div>
                  </Link>
                    <div className="search-block">
                    <Search
                        placeholder="Please enter your search"
                        enterButton="Search"
                        size="large"
                    //    onSearch={value => console.log(value)}
                        onSearch={value => this.handleSearch(value)}
                    //    onSearch={this.props.passSearch.bind(this,'aaa')}
                    />
                    </div>
                    <div className="login-module">
                        <Button type="link" className="register" shape="round" ghost size={'large'} >Register</Button>
                        <Button type="primary" className="login" shape="round" size={'large'}>Login</Button>
                    </div>
                </div>
                <div className="nav-text">
                    <ul>
                        <li> <a> <span href="javascript:;" className="amt-font">AMT</span> <span href="javascript:;" >News</span> </a> </li>
                        <li> <a> <span href="javascript:;" className="amt-font">AMT</span> <span href="javascript:;" >Faith</span> </a> </li>
                        <li> <a> <span href="javascript:;" className="amt-font">AMT</span> <span href="javascript:;" >Legal</span> </a> </li>
                        <li> <a> <span href="javascript:;" className="amt-font">AMT</span> <span href="javascript:;" >Health</span> </a> </li>
                        <li> <a> <span href="javascript:;" className="amt-font" >AMT</span> <span href="javascript:;" >Culture</span> </a> </li>
                        <li> <a> <span href="javascript:;"className="amt-font">AMT</span> <span href="javascript:;" >Youth</span> </a> </li>
                        <li> <a> <span href="javascript:;" className="amt-font">AMT</span> <span href="javascript:;">Classified</span> </a> </li>

                    </ul>
                </div>
            </div>
        )
    }
}

export default HeaderNav
